import { Route, Switch } from 'react-router-dom';

function App() {
  return (
    <div>
      <Switch>
        <Route path='/quates'></Route>
        <Route path='/quates/:quiteId'></Route>
        <Route path='/new-quate'></Route>
      </Switch>

    </div>
  );
}

export default App;
